def vowels_count(s):
    """"""
    if not isinstance(s, str):
        return 'Invalid input! Please provide a string.'
    vowels = ['a', 'e', 'i', 'o', 'u', 'y']
    s = s.lower()
    count = sum((1 for char in s if char in vowels))
    if s and s[-1] == 'y':
        count += 1
    return count
